import React from 'react';
import { getGenres } from '../../service/fakeGenreService';
import _ from 'lodash';


const ListGroup = props => {
  const { onSort } = props
  const list = getGenres()

  return (
    <nav>
      <ul className="list-group">
        {list.map((item, i) => (
          <li key={i} className={item ? 'list-group-item' : 'list-group-item'}>
            <a className="page-link" onClick={() => onSort()}>
              {item.name}
            </a>
          </li>
        ))}

      </ul>
    </nav>
  )

}

export default ListGroup
